import React from "react";
import Button from "../Button/Button";
import "./ErrorTab.css";
const ErrorTab = (props) => {
  return (
    <div className="modal">
      <header className="header">{props.title}</header>
      <p className="content">{props.message}</p>
      <footer className="actions">
        <Button>okay</Button>
      </footer>
    </div>
  );
};
export default ErrorTab;
